angular.module('babyBuddyApp')

    .controller('addAccount', function ($scope, $ionicPopup, $state, $jrCrop) {
        $scope.account = {length: 0, weight:0};

        $scope.addAccount = function(account){
            var db = new PouchDB('accounts');
            db.allDocs({
                include_docs: true,
                attachments: true
            }).then(function (result) {

                if (account != null && account.name != null && account.gender != null && account.dob != null && account.length != 0 && account.weight != 0 && $scope.image_url!=null)
                {
                        var idTemp;
                        if(result.total_rows!= 0) {
                            idTemp = parseInt(result.rows[result.rows.length - 1].doc._id) + 1;
                        }
                        else {
                            idTemp = 1;
                        }

                        var doc = {
                            "_id": idTemp+"",
                            "name": account.name,
                            "gender": account.gender,
                            "DOB": account.dob,
                            "length": account.length,
                            "weight": account.weight,
                            "imgUrl": $scope.image_url
                        };
                        db.put(doc);
                        var alertPopup = $ionicPopup.alert({
                            title: 'Success',
                            template: account.name + ' added!'
                        });
                        $state.go('accountInformation', {}, {reload: true});
                }
                else
                {
                    var alertPopup = $ionicPopup.alert({
                        title: 'Error',
                        template: 'Please fill up all fields!'
                    });
                }
            }).catch(function (err) {
                console.log(err);
            });
        }

        //select & crop image
        $scope.launchPhotoLibrary = function() {
            if (navigator.camera) {
                navigator.camera.getPicture( cameraSuccess, cameraError,
                    { sourceType: navigator.camera.PictureSourceType.PHOTOLIBRARY } );
            } else {
                console.log('no camera found, default image used');
                $scope.image_url = "data:image/png;base64,";
            }
        };
        function cameraSuccess(imageURI) {
            // hack until cordova 3.5.0 is released
            if (imageURI.substring(0,21)=="content://com.android") {
                var photo_split=imageURI.split("%3A");
                imageURI="content://media/external/images/media/"+photo_split[1];
            }
            $jrCrop.crop({
                url: imageURI,
                width: 200,
                height: 200,
                title: 'Move and Scale'
            }).then(function(resultObj) {
                // success!
                var image = resultObj.canvas.toDataURL();
                $scope.image_url = image;
            }, function() {
                // User canceled or couldn't load image.
            });
        }
        function cameraError(message) {
            alert('Failed because: ' + message);
        }
    });
